v = ""
w = ""
n = len(v)
m = len(w)
dp = [[0]*(m+1) for _ in range(n+1)] #2D matrix of size (n+1)x(m+1) initia√±ized at 0 
for i in range(n+1): #first column initalized
    dp[i][0] = i #edit distance between i characters of v and empty string
for j in range(m+1): #first row initalized
    dp[0][j] = j #edit distance empty string and j characters of w
for i in range(1, n+1): #loops through prefixes of v(i) and w(j)
    for j in range(1, m+1): #fills table row by row
        if v[i-1] == w[j-1]: #compares characters of prefix (v[i-1] and w[j-1])
            cost = 0  #if equal, no operation needed
        else:
            cost = 1 #if different (substitution)
        dp[i][j] = min( #min edit distance at (i,j), considering:
            dp[i-1][j] + 1, #deletion (remove character from v)
            dp[i][j-1] + 1, #insertion (add character to v)
            dp[i-1][j-1] + cost #substitution (change one character in v to match w)
        )
print("Edit distance between strings:", dp[n][m])
